export const setFavMatch = ({
  time,
  hometeam,
  awayteam,
  winner,
  status,
  homescore,
  awayscore,
  id,
}) => ({
  type: "SET_FAV_MATCH",
  payload: {
    id,
    time,
    hometeam,
    awayteam,
    winner,
    status,
    homescore,
    awayscore,
  },
});

export const deleteFavMatch = (props) => ({
  type: "DELETE_FAV_MATCH",
  payload: {
    ...props,
  },
});
